import React from 'react'
import './Drinks.css'

function DrinksPopUp(props) {
  return (props.trigger) ? (
    <div>
        <div>
            <button onClick={() => props.setTrigger(false)}>close</button>
            {props.children}
        </div>
    </div>
  ) : ""; 
}

export default DrinksPopUp;
